import React from 'react';
import { Link } from 'react-router-dom';

const PropertyPageItem = ({id, key, type, title,image,bestSeller,price}) => {
    
  return  (
    
    <div className="">
    
    <Link to = {`/properties/${id}`}> 
        <img src={image} alt=""/>   
    </Link> 

    <div className="">
        <h3>{title} property</h3>
        <p>${price} per night</p>
    </div>

</div>

  );
};

export default PropertyPageItem;
